import {Link} from 'react'

function homepage() {
  return (
    <nav>
      <Link to= "/">Home</Link>
      <Link to= "./about-page">About</Link>
      <Link to= "./contcat-page">Contcat</Link>
    </nav>
  )
}

export default home-page
